&amp;nbsp;न्यायपूर्ण, समृद्ध र आत्मनिर्भर राष्ट्र निर्माणको उद्देश्यसहित सीके राउतको जनमत पार्टीबाट फुटेर इन्जिनियर दीपकुमार साहको संयोजकत्वमा जनस्वराज पार्टी घोषणा गरिएको छ ।&amp;nbsp;

असोज ३ र ४ गते जनकपुरमा आयोजित प्रशिक्षण कार्यक्रमबाट जनस्वराज पार्टीको घोषणा गरिएको संयोजक साहले जानकारी दिए । &amp;nbsp;

भेलाले साहको संयोजकत्वमा प्रशिक्षण विभाग र इन्जिनियर सुरेन्द्रनारायण यादवको संयोजकत्वमा आर्थिक विभागसमेत गठन गरेको छ । पार्टी संयोजक साह यसअघि जनमत पार्टीको राष्ट्रिय उपाध्यक्ष र आर्थिक विभाग संयोजक यादव जनमतकै कोषाध्यक्ष थिए । &amp;nbs...

